import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import ShapeAnalyzer from "./components/ShapeAnalyzer";

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>Shape & Color Analyzer</h1>
        <p>
          Upload an image to detect shapes, measure dimensions, and identify
          colors
        </p>
      </header>

      <main className="main-content">
        <ShapeAnalyzer />
      </main>

      <footer className="app-footer">
        <p>&copy; {new Date().getFullYear()} Shape Detector App</p>
      </footer>
    </div>
  );
}

export default App;
